import React from 'react';
import { Link } from 'react-router-dom';

const MainMenu = () =>
{
    return (
        <div>
            Main Menu
            <div class="ui grid">
                <Link to="/faces" className="item">Faces</Link>
                <Link to="/family" className="item">Family</Link>
                <Link to="/moments" className="item">Moments</Link>
                <Link to="/music" className="item">Music</Link>
                <Link to="/work" className="item">Work</Link>
            </div>
            
        </div>
    );
};

export default MainMenu;
